int maxArea(vector<int>& height)
{
    vector<int>::size_type i = 0, j = height.size() - 1;
    int area = 0, area_tmp = 0;
    for (; i < j;){
        area_tmp = (j - i) * (height[j] > height[i]? height[i]: height[j]);
        if (area_tmp > area){
            area = area_tmp;
        }
        if(height[i] < height[j]){
            i++;
        }
        else{
            --j;
        }
    }
    return area;
}

