int climbStairs(int n)
{
    static std::unordered_map<int, int> result;
    if(n == 1){
        return 1;
    }
    if (n == 2){
        return 2;
    }
    int r1 = 0, r2 = 0;
    auto it = result.find(n-1);
    if(it == result.end()){
        r1 = climbStairs(n-1);
        result[n-1] = r1;
    }
    else{
        r1 = it->second;
    }

    auto it2 = result.find(n-2);
    if (it2 == result.end()){
        result[n-2] = climbStairs(n-2);
    }
    else{
        return r1 + it2->second;
    }


    return r1 + result[n-2];
}

