int maxFrequency(vector<int>& nums, int k) {
    sort(nums.begin(), nums.end());
    int ans = 1;
    int left = 0;
    int sum = 0;
    for(int i=1; i<nums.size(); ) {
        if(nums[i-1] < nums[i]) {
            int delt = nums[i] - nums[i-1];

            if(sum + (i-left+1)*delt > k) {
                //ans = ans>(i-left+1)?ans:(i-left+1);
                ans = ans>(i-left)?ans:(i-left);
                sum -= nums[i-1] - nums[left];
                ++left;
            } else {
                ans = ans>(i-left+1)?ans:(i-left+1);
                sum += (i-left+1)*delt;
                ++i;
            }
        } else {
            ans = ans>(i-left+1)?ans:(i-left+1);
            ++i;
        }
    }

    return ans;
}

int longestBeautifulSubstring(string word) {
    char d[26] = {'a','e','i','o','u'};
    memset(d, 0 ,26);
    d['a' - 'a'] = 'e';
    d['e' - 'a'] = 'i';
    d['i' - 'a'] = 'o';
    d['o' - 'a'] = 'u';
    d['u' - 'a'] = 'u';

    int sum = 0;
    int ans = 0;
    char pre = 0;
    int i=0;
    for(i=0; i<word.size(); ++i) {
        if(word[i] == 'a') {
            pre = 'a';
            break;
        }
    }
    if(pre != 'a') {
        return 0;
    }
    int j=i;
    for(j=i; j<word.size(); ++j) {
        if(pre == 0) {
            if(word[j] == 'a') {
                pre = 'a';
            } else {
                continue;
            }
        }
        if(word[j] == pre ) {
            sum ++;
        } else if(word[j] == d[pre-'a']) {
            sum ++;
            pre = d[pre-'a'];
        } else {
            if(pre == 'u'){
                ans = ans>sum?ans:sum;
            }
            sum =0;
            pre = 0;
        }
    }

    return ans;
}


