class SeatManager {
    //vector<int> vec;
    vector<int> status;
    priority_queue<int, vector<int>, greater<int>> q;
public:
    SeatManager(int n) {
        //vec.resize(n+1);
        status.resize(n+1);
        for(int i=1; i<=n; n++) {
            q.push(i);
            status[i] = 0;
        }
    }

    int reserve() {
        while(!q.empty()) {
            int ret = q.top();
            q.pop();
            if(status[ret] == 0) {
                status[ret] = 1;
                return ret;
            }
        }
        return -1;
    }

    void unreserve(int seatNumber) {
        q.push(seatNumber);
        status[seatNumber] = 0;
    }
};


